
-- Gameobjects are the veins
-- Pool_gameobject holds gameobjects on the same pool
-- Pool_template defines how many gameobjects in pool_gameobject can spawn

-- Query to find Pool_template:
--      SELECT entry, max_limit, description FROM pool_template WHERE pool_template.description LIKE 'tin%';

-- Query to find Pool_gameobject:
--      SELECT pool_template.description, pool_gameobject.guid, pool_gameobject.pool_entry, pool_gameobject.chance, pool_gameobject.description, pool_gameobject.flags FROM pool_gameobject INNER JOIN pool_template ON pool_gameobject.pool_entry = pool_template.entry WHERE pool_template.description LIKE 'tin%';

-- Query to find Gameobjects: 
--      SELECT gameobject.guid, gameobject.id, gameobject.map, gameobject.position_x, gameobject.position_y, gameobject.position_z, gameobject.orientation, gameobject.rotation0, gameobject.rotation1, gameobject.rotation2, gameobject.rotation3, gameobject.spawntimesecsmin, gameobject.animprogress, gameobject.state 
--      FROM gameobject 
--      INNER JOIN pool_gameobject ON pool_gameobject.guid = gameobject.guid
--      INNER JOIN pool_template ON pool_template.entry = pool_gameobject.pool_entry WHERE pool_template.description LIKE 'tin%';

-- Query to find an available gameobject entry:
--      SELECT * FROM pool_gameobject WHERE pool_gameobject.guid >= 10230 AND pool_gameobject.guid <= 10230 + 330;

SET @TIN_GAMEOBJECT_ENTRY = 10230;
SET @TIN_POOL_TEMPLATE_ENTRY = 500;

DELETE FROM `pool_template` WHERE `entry` >= @TIN_POOL_TEMPLATE_ENTRY && `entry`<= @TIN_POOL_TEMPLATE_ENTRY + 13;
DELETE FROM `pool_gameobject` WHERE `pool_entry` >= @TIN_POOL_TEMPLATE_ENTRY && `pool_entry`<= @TIN_POOL_TEMPLATE_ENTRY + 13;

SET @TIN_GAMEOBJECT_ENTRY = 10230;
SET @TIN_POOL_TEMPLATE_ENTRY = 500;

-- Cleaning up pool_gameobject
-- Query to find out what gameobjects are inserted in pool_gameobject with the 'Tin Vein' gameobject_template
--      SELECT * FROM pool_gameobject INNER JOIN gameobject ON gameobject.guid = pool_gameobject.guid WHERE `id` IN (1732, 2054, 3764, 103711, 181249);

DELETE pool_gameobject FROM pool_gameobject LEFT JOIN gameobject ON gameobject.guid = pool_gameobject.guid WHERE gameobject.id IN (1732, 2054, 3764, 103711, 181249);

-- 329 Tin Vein Gameobjects pooled

SET @TIN_GAMEOBJECT_ENTRY = 10230;

-- Cleaning up Tin Vein Gameobjects
DELETE FROM `gameobject` WHERE `id` IN (1732, 2054, 3764, 103711, 181249);

-- 329 Tin Vein gameobjects

